css:
.select-list.popover-list {
  z-index: 2 !important;
}
.atom-color-highlight {
  z-index: 1;
  position: relative;
}
.atom-color-highlight .dot-marker {
  display: block;
  position: absolute;
  border-radius: 50%;
  margin-top: 2px;
  z-index: -2;
}
.atom-color-highlight .dot-marker.selected .selector {
  position: absolute;
  height: 0;
  width: 0;
  border: 6px solid transparent;
  border-bottom-color: #0098ff;
  left: 50%;
  margin-left: -6px;
  top: 100%;
}
.atom-color-highlight .marker.selected {
  display: none;
}
.atom-color-highlight .region {
  -webkit-font-smoothing: antialiased;
  position: absolute;
  padding: 0px 2px;
  margin-left: -1px;
  display: inline-block;
  line-height: inherit;
  box-sizing: content-box;
  border-radius: 2px;
  z-index: -2;
  white-space: pre;
}
.atom-color-highlight .dot-marker:before,
.atom-color-highlight .region:before {
  content: '';
  display: block;
  position: absolute;
  width: 100%;
  height: 100%;
  background: url(atom://atom-color-highlight/resources/transparent-background.png);
  top: 0;
  left: 0;
  z-index: -1;
  border-radius: inherit;
}
.atom-color-highlight .dot-marker:after,
.atom-color-highlight .region:after {
  content: '';
  display: block;
  position: absolute;
  width: 100%;
  height: 100%;
  background: inherit;
  z-index: -1;
  top: 0;
  left: 0;
  border-radius: inherit;
}
